lyrics:
Another version of IT111-XXXX-VE-VA-013

 Din don dan,
 Le campane del Volan
 Le sonava dì e note,
 Le bateva zo le porte,
 ma le porte xe de fero.
 Volta la carta, ghe xe un capelo,
 Un capelo pien de piova;
 Volta la carta, ghe xe na rosa,
 Na rosa che sa de bon;
 Volta la carta, ghe xe un limon,
 Un limon massa fato;
 Volta la carta, ghe xe un mato,
 Un mato da ligare;
 Volta la carta, ghe xe un mare,
 Un mare e na marina;
 Volta la carta, ghe xe na galina,
 Na galina che fa co-co-dè;
 Volta la carta, ghe xe un rè,
 Un rè e un rearo;
 Volta la carta, ghe xe un peraro,
 Un peraro che fa dei peri;
 Volta la carta, ghe xe du sbiri,
 Du sbiri che tra de cao;
 Volta la carta, ghe xe un pao,
 Un pao col colo rosso;
 Volta la carta, ghe xe un posso,
 Un posso pien de àqua;
 Volta la carta, ghe xe na gata,
 Una gata con du gatei;
 Volta la carta, ghe xe tre putei,
 Tre putei i va a l’osteria;
 Volta la carta e la xe finia.

[Karaoke: 105.kar]

 Passa, passa Gabriel,
 todo o mundo passa;
 passa, passa Gabriel,
 todo o mundo passa;
 os (pescadores) fazem assim.
 Ai, ai, ai, ai, todo o mundo passa.

 Passa, passa Gabriel,
 todo o mundo passa;
 passa, passa Gabriel,
 todo o mundo passa;
 os (camponeses) fazem assim.
 Ai, ai, ai, ai, todo o mundo passa.
